import React from "react";

import styles from "./About.module.css";
import { getImageUrl } from "../../utils";

export const About = () => {
  return (
    <section className={styles.container} id="about">
      <h2 className={styles.title}>About</h2>
      <div className={styles.content}>
        <img
          src={getImageUrl("about/aboutImage.png")}
          alt="Me sitting with a laptop"
          className={styles.aboutImage}
        />
        <ul className={styles.aboutItems}>
          <li className={styles.aboutItem}>
            
            <div className={styles.aboutItemText}>
              <p>
                Motivated and detail-oriented B.Tech student with a strong academic background in Information Technology.Possessing excellent problem- solving and analytical skills as well as ability to work well in a team with a strong work ethic and a positive attitude, I am eager to apply my knowledge 
              </p>
            </div>
          </li>
          
        </ul>
      </div>
    </section>
  );
};
